events.script:
main()
{
  string Adr;
  Adr = DP + &quot;.Out_Control.cOnRead_ds&quot;;
  dpSet(Adr,1);

  dpConnect(&quot;cbWorker&quot;, DP + &quot;.Out_Control.dsKUN&quot;,               //1- Состояние КУНы
                        DP + &quot;.Out_Control.dsKUZ&quot;,               //2- Состояние КУЗ
                        DP + &quot;.Out_Control.dsPumpStarter&quot;,       //3- Пускатель насоса
                        DP + &quot;.Out_Control.dsAirVlv&quot;,            //4- Воздушный клапан
                        DP + &quot;.Out_Control.dsGreenSignal&quot;,       //5- Зеленый сигнал для светофора
                        DP + &quot;.Out_Control.dsRedSignal&quot;,         //6- Красный сигнал для светофора
                        DP + &quot;.Out_Control.dsMinFlowVlv&quot;,        //7- Клапан минимального расхода
                        DP + &quot;.Out_Control.dsMaxFlowVlv&quot;,        //8- Клапан максимального расхода
                        DP + &quot;.Out_Control.dsPumpVlv&quot;,           //9- Насос клапана
                        DP + &quot;.Out_Control.dsBarrier&quot;            //10- Блок управления шлагбаумом
                        );
}

void cbWorker(dyn_string dp, dyn_anytype val){


  switch(val[1]){
    case 0:
      KUN.text(&quot;Стоп&quot;);
      break;
    case 1:
      KUN.text(&quot;Аварийный стоп&quot;);
      break;
    case 2:
      KUN.text(&quot;Авария&quot;);
      break;
    case 3:
      KUN.text(&quot;Ожидание&quot;);
      break;
    case 4:
      KUN.text(&quot;Пуск&quot;);
      break;
    case 5:
      KUN.text(&quot;Работа&quot;);
      break;
    default:
      KUN.text(&quot;Состояние КУНы неизвестно&quot;);
  }

  switch(val[2]){
    case 0:
      KUZ.text(&quot;Авария при закрытии&quot;);
      break;
    case 1:
      KUZ.text(&quot;Авария при открытии&quot;);
      break;
    case 2:
      KUZ.text(&quot;Авария&quot;);
      break;
    case 3:
      KUZ.text(&quot;Ожидание&quot;);
      break;
    case 4:
      KUZ.text(&quot;Пуск&quot;);
      break;
    case 5:
      KUZ.text(&quot;Работа&quot;);
      break;
    default:
      KUZ.text(&quot;Состояние КУЗ неизвестно&quot;);
  }
  if(val[3] == 1)
    setValue(&quot;PumpStarter&quot;, &quot;backCol&quot;, &quot;Green&quot;);
  else
    setValue(&quot;PumpStarter&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[4] == 1)
    setValue(&quot;AirVlv&quot;, &quot;backCol&quot;, &quot;Green&quot;);
  else
    setValue(&quot;AirVlv&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[5] == 1)
    setValue(&quot;GreenSignal&quot;, &quot;backCol&quot;, &quot;Green&quot;);
  else
    setValue(&quot;GreenSignal&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[6] == 1)
    setValue(&quot;RedSignal&quot;, &quot;backCol&quot;, &quot;Green&quot;);
  else
    setValue(&quot;RedSignal&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[7] == 1)
    setValue(&quot;MinFlowVlv&quot;, &quot;backCol&quot;, &quot;Green&quot;);
  else
    setValue(&quot;MinFlowVlv&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[8] == 1)
    setValue(&quot;MaxFlowVlv&quot;, &quot;backCol&quot;, &quot;Green&quot;);
  else
    setValue(&quot;MaxFlowVlv&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[9] == 1)
    setValue(&quot;PumpVlv&quot;, &quot;backCol&quot;, &quot;Green&quot;);
  else
    setValue(&quot;PumpVlv&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[10] == 2)
    setValue(&quot;Barrier&quot;, &quot;backCol&quot;, &quot;Green&quot;);
  else
    setValue(&quot;Barrier&quot;, &quot;backCol&quot;, &quot;White&quot;);
}
